var title_f20_59_21424="Balance walk video";
var content_f20_59_21424=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1070px;\">",
"  <div class=\"videoplayer\" h264=\"./images/PC/59269/Balance_walk_video.mp4?title=Balance+walk+video\" style=\"width:480px;height:336px\">",
"  </div>",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Balance exercise video: Balance walk",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 374px; height: 306px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Good balance helps you walk safely and avoid tripping and falling over objects in your way.",
"    <br>",
"     <ol>",
"      <li>",
"       Raise arms to sides, shoulder height.",
"      </li>",
"      <li>",
"       Choose a spot ahead of you and focus on it to keep you steady as you walk.",
"      </li>",
"      <li>",
"       Walk in a straight line with one foot in front of the other.",
"      </li>",
"      <li>",
"       As you walk, lift your back leg. Pause for one second before stepping forward.",
"      </li>",
"      <li>",
"       Repeat for 20 steps, alternating legs.",
"      </li>",
"     </ol>",
"     As you progress, try looking from side to side as you walk, but skip this step if you have inner ear problems.",
"     <div class=\"footnotes\">",
"     </div>",
"     <div class=\"reference\">",
"      Reproduced from: Go4Life. National Institute on Aging at the National Institutes of Health. Available at: file://go4life.niapublications.org (Accessed December 2, 2011).",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
