var title_f20_59_21436="Cairo-Bishop TLS grading";
var content_f20_59_21436=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F72208&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F72208&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Cairo-Bishop clinical tumor lysis syndrome definition* and grading",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\" rowspan=\"2\">",
"       Complication",
"      </td>",
"      <td class=\"subtitle1\" colspan=\"6\">",
"       Grade",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2\">",
"       0",
"      </td>",
"      <td class=\"subtitle2\">",
"       1",
"      </td>",
"      <td class=\"subtitle2\">",
"       2",
"      </td>",
"      <td class=\"subtitle2\">",
"       3",
"      </td>",
"      <td class=\"subtitle2\">",
"       4",
"      </td>",
"      <td class=\"subtitle2\">",
"       5",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Creatinine&bull;&Delta;",
"      </td>",
"      <td>",
"       &le;1.5 x ULN",
"      </td>",
"      <td>",
"       1.5 x ULN",
"      </td>",
"      <td>",
"       &gt;1.5-3.0 x ULN",
"      </td>",
"      <td>",
"       &gt;3.0-6.0 x ULN",
"      </td>",
"      <td>",
"       &gt;6.0 x ULN",
"      </td>",
"      <td>",
"       Death",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Cardiac arrhythmia&bull;",
"      </td>",
"      <td>",
"       None",
"      </td>",
"      <td>",
"       Intervention not indicated",
"      </td>",
"      <td>",
"       Nonurgent medical intervention indicated",
"      </td>",
"      <td>",
"       Symptomatic and incompletely controlled medically or controlled with device (eg, defibrillator)",
"      </td>",
"      <td>",
"       Life-threatening (eg, arrhythmia associated with HF, hypotension, syncope, shock)",
"      </td>",
"      <td>",
"       Death",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Seizure&bull;",
"      </td>",
"      <td>",
"       None",
"      </td>",
"      <td>",
"       -",
"      </td>",
"      <td>",
"       One brief, generalized seizure; seizure(s) well controlled by anticonvulsants or infrequent focal motor seizures not interfering with ADL",
"      </td>",
"      <td>",
"       Seizure in which consciousness is altered; poorly controlled seizure disorder; with breakthrough generalized seizures despite medical intervention",
"      </td>",
"      <td>",
"       Seizure of any kind which are prolonged, repetitive or difficult to control (eg, status epilepticus, intractable epilepsy)",
"      </td>",
"      <td>",
"       Death",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ULN: upper limit of normal; HF: heart failure; ADL: activities of daily living.",
"     <br>",
"      * Clinical tumor lysis syndrome defined as laboratory tumor lysis syndrome plus at least one clinical complication",
"      <br>",
"       &bull; Not directly or probably attributable to therapeutic agent.",
"       <br>",
"        &Delta; If no institutional ULN is specified, age/sex ULN creatinine may be defined as follows: &gt;1 to &lt;12 years of age, both male and female, 61.6 mmol/L; &ge;12 to &lt;16 years, both male and female, 88 mmol/L; &ge;16 years, female 105.6 mmol/L, male 114.4 mmol/L.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Coiffier B, Altman A, Pui CH, et al. Guidelines for the management of pediatric and adult tumor lysis syndrome: an evidence-based review. J Clin Oncol 2008; 26:2767. Copyright &copy; 2008 American Society of Clinical Oncology. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
