var title_f20_59_21438="HP caused by Cladosporium";
var content_f20_59_21438=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F52421&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F52421&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Hypersensitivity pneumonitis caused by Cladosporium in an enclosed hot-tub",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 450px; height: 344px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Spirometry from a 48-year-old woman with an 18-month history of malaise and chronic cough, intermittent episodes of fever, chills, and pneumonic infiltrates. Removal of the patient from the home environment led to a resolution of symptoms within&nbsp;one week. Within&nbsp;four hours of reexposure to the hot-tub room, symptoms and signs and changes in leukocyte count and spirometric values again occurred. Bronchial provocation with a commercial extract of C. cladosporioides led to a similar pattern&nbsp;five hours after the initial challenge.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from: Jacobs RL, Thorner RE, Holcomb JR, et al. Ann Intern Med 1986; 105:204.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
